// import { Container } from './styles';

class Categorias extends Component {
	render() {
		return (
            <div className="tabs tabs-alt clearfix" id="tabs-profile2">

				<ul className="tab-nav clearfix">
					<li><a href="#tab-criar"><i className="icon-rss2"></i> Criar</a></li>
					<li><a href="#tab-editar"><i className="icon-pencil2"></i> Editar</a></li>
					<li><a href="#tab-listagem"><i className="icon-reply"></i> Listagem</a></li>
				</ul>

				<div className="tab-container">

					<div className="tab-content clearfix" id="tab-criar">

					</div>
					<div className="tab-content clearfix" id="tab-editar">

					</div>
					<div className="tab-content clearfix" id="tab-listagem">


					</div>

				</div>

			</div>
		);
	}
}


export default Categorias;
